    fun getIPFS(){
        val client = OkHttpClient()

        val mediaType = MediaType.parse("multipart/form-data; boundary=---011000010111000001101001")
        val body = RequestBody.create(mediaType, "-----011000010111000001101001\r\nContent-Disposition: form-data; name=\"filePath\"\r\n\r\ndata:image/png;name=/external_files/DCIM/images.png;base64,\r\n-----011000010111000001101001--\r\n\r\n")
        val request = Request.Builder()
            .url("https://api.verbwire.com/v1/nft/store/file")
            .post(body)
            .addHeader("accept", "application/json")
            .addHeader("content-type", "multipart/form-data; boundary=---011000010111000001101001")
            .addHeader("X-API-Key","")
            .build()

        val response = client.newCall(request).execute()
        Toast.makeText(requireContext(), response.toString(), Toast.LENGTH_SHORT).show()
    }

